response.about:
Б/у,но в отличном состоянии;
Класс - класика;
Год выпуска - 1990;
Цвет - светлый;
Высота – 170 см;
Вес 65 кг;
Фары - серые;
Кузов - не битый, не ржавый, не гнилой, антикор, полировка.
Тип топлива - пиво...и т.д...;
Привод - класический - задний;
Расход топлива - минимальный;
Резина шипованная. На крутых поворотах иногда заносит.
Тормоза с ABS, ручник в нормальном состоянии.
Полный фарш,все опции, но иногда клинит.
Педали - что-то между мягкими и жесткими.
Руль - легкий, но при неаккуратном обращении может клинить, и притом сильно, а также отказывать в управлении вовсе.
Салон в отличном состоянии из светловатой кожи,в летнее время практически не загорает.
